import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import projectData from "../data/project"; // Dosya yolunu kendine gÃ¶re ayarla

const Project = () => {
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold mb-8">Projeler</h1>

      {/* Carousel 1 */}
      <div className="mb-10">
        <h2 className="text-2xl font-semibold mb-4">ðŸŽ¯ Carousel 1</h2>
        <Swiper
          spaceBetween={20}
          slidesPerView={1}
          breakpoints={{
            640: { slidesPerView: 2 },
            1024: { slidesPerView: 3 },
          }}
        >
          {projectData.map((proj, i) => (
            <SwiperSlide key={i}>
              <div className="bg-white rounded-xl shadow-md p-4 h-full">
                <h3 className="text-lg font-bold mb-3">{proj.title}</h3>
                <ul className="list-disc list-inside text-sm text-gray-700 space-y-1">
                  {proj.description.map((line, idx) => (
                    <li key={idx}>{line}</li>
                  ))}
                </ul>
              </div>
            </SwiperSlide>
          ))}
        </Swiper>
      </div>

      {/* Carousel 2 */}
      <div className="mb-10">
        <h2 className="text-2xl font-semibold mb-4">ðŸš€ Carousel 2</h2>
        <Swiper
          spaceBetween={20}
          slidesPerView={1}
          breakpoints={{
            640: { slidesPerView: 2 },
            1024: { slidesPerView: 3 },
          }}
        >
          {projectData.map((proj, i) => (
            <SwiperSlide key={i}>
              <div className="bg-white rounded-xl shadow-md p-4 h-full">
                <h3 className="text-lg font-bold mb-3">{proj.title}</h3>
                <ul className="list-disc list-inside text-sm text-gray-700 space-y-1">
                  {proj.description.map((line, idx) => (
                    <li key={idx}>{line}</li>
                  ))}
                </ul>
              </div>
            </SwiperSlide>
          ))}
        </Swiper>
      </div>
    </div>
  );
};

export default Project;
